Carlsbad Caverns National Park in the Guadalupe Mountains is a United States National Park and a UNESCO World Heritage Site. Located in southeastern New Mexico, the greatest attraction of the park is the Carlsbad Cavern which consists of over 117 limestone caves formed from the underground action of sulphuric acid. The surrounding region is a beautiful vista of canyons and shrubby grasslands. Visitors can hike in through the natural cave entrance or take an elevator from the visitor center.

Carlsbad Caves consists mainly of a large cavern called the Big Room. The Big Room is a 4,000-feet long, 625-feet wide, and 255-feet high natural limestone chamber ‚Äì third largest chamber in North America. In the world, the Big Room ranks seventh among natural cave chambers. The park has been entered twice in the National Register of Historic Places ‚Äì once as the Caverns Historic District and again as the Rattlesnake Springs Historic District. The Slaughter Canyon Cave offers an underground tour of the wilderness without modern amenities and initiates visitors into the secrets of natural living, now quite forgotten. The Bat Flight is another major attraction.
